import Menu from '../../menu/Menu';
import { useState } from 'react';
import useDelayUnmount from '../../../utils/useDelayUnmount';

const NavList = () => {
  const [showMenu, setShowMenu] = useState(false);

  const handleToggleClicked = () => {
    showMenu ? useDelayUnmount(showMenu, 500) : setShowMenu(!isMounted);
  };

  return (
    <>
      <ul className="navigation__list-container">
        <li className="navigation__menu" onClick={() => setShowMenu(!showMenu)}>
          <span className="navigation__text">Menu</span>
        </li>
      </ul>
      {showMenu ? <Menu /> : null}
    </>
  );
};

export default NavList;
